import './App.css';
import React, { useState } from "react";
import { Link, BrowserRouter,Router,Route} from "react-router-dom"; 
import Home from "./components/Home";



// Exemple d'import correct


function App() {
  return (
    <BrowserRouter>
    <Router>
      <Route path="/" element={<Home/>} />
    </Router>
    </BrowserRouter>
  );
}

export default App;
